import React from "react";
import styles from "./left.module.scss";
import LoginImg from "../../../../assets/login.png"

function Left(){
    return (
        <section className={styles.left}>

            <img src={LoginImg} alt="login image"></img>
            <div>
                <h1>
                    keep life simple
                </h1>
                <p>
                Store all your notes in a simple and /n intuitive app that helps you enjoy what is most important in life.
                </p>
            </div>
        </section>
    )
}

export default Left
